$(document).ready(function(){

	$('.box-slider').slick({
		slidesToShow: 1,
		slidesToScroll: 1,
		arrows:true,
		draggable:true,
		mobileFirst:true,
	});

    $(".lazyload").lazyload();

	$(".slick-arrow").on("mouseenter", function(){
        if($(this).is(".slick-prev")){
        	$(".slick-slider").addClass("active-prev");
        }else if($(this).is(".slick-next")){
        	$(".slick-slider").addClass("active-next");
        }
    });
    $(".slick-arrow").on("mouseleave", function(){
    	$(".slick-slider").removeClass("active-prev");
        $(".slick-slider").removeClass("active-next");
    });
    
	$('#fullpage').fullpage({
		menu: '#navigation',
		anchors:['home', 'about', 'team', 'design', 'room', 'slider', 'block-footer']
	});

	$.fn.fullpage.setAllowScrolling(true);
	

});

